	    		logo:"http://tp2.sinaimg.cn/1786215421/180/40069698759/1"
	        });
	        /*动画*/
	        document.getElementById('testAnimate').addEventListener('click',function(){
	        	var duration = 2000;
	        	var start = +new Date();
	        	var pan = ol.animation.pan({
	        		duration:duration,
	        		source:(view.getCenter()),
	        		start:start
	        	});
	        	var bounce = ol.animation.bounce({
	        		duration:duration,
	        		resolution:4*view.getResolution(),
	        		start:start
	        	});
	        	map.beforeRender(pan, bounce);
	        	view.setCenter([100, 30]);
	        });
	        /*DragBox*/
	        var select = new ol.interaction.Select();
	        var dragBox = new ol.interaction.DragBox({
	        	condition: ol.events.condition.platformModifierKeyOnly
	        });


	        /*Modify*/
	        var features3 = new ol.Collection(features2);
	        var modify = new ol.interaction.Modify({
		        features: features3,
		        deleteCondition: function(event) {
		          return ol.events.condition.shiftKeyOnly(event) &&
		              ol.events.condition.singleClick(event);
		        }
	        });
	        map.addInteraction(modify);
	        
	        map.addInteraction(select);
	        map.addInteraction(dragBox);
	        var selectedFeatures = select.getFeatures();
	        var infoBox = document.getElementById('info');
	        dragBox.on('boxend',function(e){
	        	var info =[];
	        	var extent = dragBox.getGeometry().getExtent();
	        	vectorSource.forEachFeatureIntersectingExtent(extent, function(feature) {
		          selectedFeatures.push(feature);
		          info.push(feature.get('name'));
		        });
		        if (info.length > 0) {
		          infoBox.innerHTML = info.join(', ');
		        }
	        });
	        dragBox.on('boxstart', function(e) {
		        selectedFeatures.clear();
		        infoBox.innerHTML = '&nbsp;';
	      	});
	      	map.on('click',function(evt){
	      		selectedFeatures.clear();
	        	infoBox.innerHTML = '&nbsp;';

	      		if (evt.dragging) {
		          return;
		        }
		        //getEventPixel返回的是map的页面中的位置，而不是map数据中的坐标值
		        var pixel = map.getEventPixel(evt.originalEvent);
		        var features = [];
		        map.forEachFeatureAtPixel(pixel, function(feature, layer) {
		          features.push(feature);
		        });
		        if (features.length > 0) {
		          var info = [];
		          var i, ii;
		          for (i = 0, ii = features.length; i < ii; ++i) {
		            info.push(features[i].get('name'));
		          }
		          document.getElementById('info2').innerHTML = info.join(', ') || '&nbsp';
		        } else {
		          document.getElementById('info2').innerHTML = '&nbsp;';
		        }
	      	});

	  	},
	  	error:function(){
	  		console.log('faile to request data');
	  	}
	  });
        </script>
    </body>
</html>

